import Eueno from '../index';

describe('get shared files', () => {
  let eueno;
  beforeEach(() => {
    eueno = new Eueno({
      endpoint: 'eueno-endpoint',
      ipfsGateway: 'ipfs-gatewat',
    });
  });
  describe('get shared files', () => {
    test('success', async () => {
      const files = await eueno.getSharedFiles(
        {
          privateKey: 'account-private-key',
          projectId: 'project-id',
          relFolderPath: 'relative-folder-path',
          page: 'page',
          limit: 'limit'
        },
      );
    });
  });
});
